- input: "TEXT\x1CC00355941\x1C.TEXT\x1C\x1CF3XA\x1CTime Warner Telecom Inc. payroll
    department made an error in the amount of the check presented to Time Warner Telecom
    Inc PAC for direct deposit contributions.  Harold Smith enrolled in payroll deduction
    of PAC contributions in the amount of $57.69 per pay period.  The corporate payroll
    system indicate a payroll deduction by Harold Smith on 05/04/2007 in the amount
    of $2264.23.  This information was used to prepare a check in the amount of $6524.93
    to Time Warner Telecom Inc PAC, when in fact the correct amount should have been
    $4260.70.  The error was caught and corrected before payroll checks were issued
    and Mr. Smith did not have a deduction of $2264.23 on his paycheck dated 05/04/07.
    \ In fact, his payroll reflected no contributions at all to Time Warner Telecom
    Inc. PAC.  Time Warner Telecom Inc. reconciled its account with Time Warner Telecom
    Inc. PAC by reflecting Mr. Smith's 05/18/07 payroll deduction as a credit of $2206.54
    ($2264.23 less Mr. Smith's requested contribution of $57.69).  Mr. Smith's paycheck
    dated 05/18/07 reflected a PAC contribution in the amount of $57.69."
  record: fec.version.v6_2.TEXT
